import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import Router components
import LoadingPage from './comp/LoadingPage';
import GlobalMap from './comp/GlobalMap';
import NavBar from './comp/NavBar'; // Import your NavBar component
import './App.css';

const App = () => {
    return (
        <Router>
            <div className="App">
                <NavBar /> {/* Add the NavBar here */}
                <Switch>
                    <Route path="/" exact component={LoadingPage} /> {/* Loading page */}
                    <Route path="/global-map" component={GlobalMap} /> {/* GlobalMap page */}
                </Switch>
            </div>
        </Router>
    );
};

export default App;
